// Get the text field
var fieldValue = $feature["name"]

// Split the text into individual words
var words = Split(fieldValue, " ")

// Initialize variables
var currentLine = ""
var result = ""

// Loop through each word
for (var i = 0; i < Count(words); i++) {
    var word = words[i]

    // Check if adding the word would exceed 20 characters
    if (Count(currentLine) + Count(word) + 1 <= 20) {
        // If not, add the word to the current line

        if (Count(currentLine) == 0) {
            currentLine = word
        } else {
            currentLine += " " + word
        }
    } else {
         console("here")
        // If it would exceed, add the current line to the result with a newline
        result += currentLine + TextFormatting.NewLine
        // Start a new line with the current word
        currentLine = word
    }
}

// Add the last line to the result
result += currentLine
// Return the final formatted text
return result

