function FormatDateWithTimeAgo(time_utc) {
    // Get the current time
    var currentTime = Now();

    // Format the feature's time to "Month Day, Year at Hour:Minute:Second AM/PM TimeZone"
    var formattedTime = Text(time_utc, 'MMMM D, Y, h:mm:ss A ZZZZ');

    // Calculate the difference in days, hours, minutes, and seconds
    var diffDays =  Round(DateDiff(currentTime, time_utc, 'days'));
    var diffHours =  Round(DateDiff(currentTime, time_utc, 'hours') % 24);
    var diffMinutes =  Round(DateDiff(currentTime, time_utc, 'minutes') % 60);
    var diffSeconds =  Round(DateDiff(currentTime, time_utc, 'seconds') % 60);

    // Create the time difference string
    var diffString = '';

    if (diffDays > 0) {
        diffString += diffDays + " day" + IIf(diffDays > 1, "s", "");
    }

    if (diffHours > 0) {
        if (diffString != '') {
            diffString += ", ";
        }
        diffString += diffHours + " hour" + IIf(diffHours > 1, "s", "");
    }

    if (diffMinutes > 0) {
        if (diffString != '') {
            diffString += ", ";
        }
        diffString += diffMinutes + " minute" + IIf(diffMinutes > 1, "s", "");
    }

    if (diffSeconds > 0) {
        if (diffString != '') {
            diffString += " and ";
        }
        diffString += diffSeconds + " second" + IIf(diffSeconds > 1, "s", "");
    }

    // Combine formatted time and difference string
    var resultString = formattedTime + " (" + diffString + " ago)";

    return resultString;
}


